import React,{Component} from 'react'


class Pagamento extends Component{
    constructor(props){
        super(props)
    
        this.state = {
          isLoading: false
        }
    }
    

    render(){
        return(

            <h1>Receita Federal</h1>


        );
    }



}


export {Pagamento}
